import '../style/table.css'
import Tbody from "./Tbody";

const Table = () => {
    return (
        <div>
            <div className="table">
                <section className="table__body">
                    <table>
                        <thead>
                        <tr>
                            <th> Id </th>
                            <th> Title </th>
                            <th> Location </th>
                            <th> Deadline </th>
                            <th> Status </th>
                            <th> Budget </th>
                        </tr>
                        </thead>
                        <Tbody/>
                    </table>
                </section>
            </div>
        </div>
    );
};

export default Table;
